import React from "react";
import { Box, Typography, Link, Divider, Grid, Container } from "@mui/material";

const Header = () => {
  return (
    <>
      <Container maxWidth='md'>
        <Typography variant="h3" my={3} align="center">
          Classificador de Fake News
        </Typography>
        <Divider mb={2} />
        <Container maxWidth="sm" sx={{ fontSize: 14 }}>
          <Typography variant="h6" mb={1} mt={2}>
            <strong>Como Funciona?</strong>
          </Typography>
          <Box sx={{ display: "flex", flexDirection: "column" }}>
            <Typography variant="span" mb={1}>
              Copie o texto completo da notícia, cole no campo abaixo e clique
              em "Enviar".
            </Typography>
            <Typography variant="span">
              Nosso sistema irá processar o texto e classificar a possibilidade
              da notícia ser falsa.
            </Typography>
          </Box>
        </Container>
      </Container>
    </>
  );
};

export default Header;
